const tmdbApiKey = 'cf64a661774f647b7513facb9f1e55e5';
const tmdbApiUrl = 'https://api.themoviedb.org/3/movie/';

const seriesList = document.getElementById('movie-list');
const loadingMessage = document.getElementById('loading-message');

// إزالة رسالة التحميل
seriesList.removeChild(loadingMessage);

// جلب معلومات الأفلام من TMDB بناءً على معرّفات TMDB
Promise.all(tmdbIds.map(id => 
  fetch(`${tmdbApiUrl}${id}?api_key=${tmdbApiKey}&language=en-US`)
    .then(response => response.json())
    .then(data => {
      const year = data.release_date ? new Date(data.release_date).getFullYear() : 'Unknown Year';
      return {
        title: data.title || 'Unknown Title',
        year: year,
        id: data.id, // الاحتفاظ بالمعرّف
      };
    })
    .catch(error => {
      console.error(`Error fetching data for TMDB ID ${id}:`, error);
    })
))
.then(movies => {
  const links = movies.filter(Boolean).map(movie => {
    const listItem = document.createElement('li');
    listItem.classList.add('movie-item');
    listItem.innerHTML = `<a href="movie.html?tmdb_id=${movie.id}" rel="noopener noreferrer">${movie.title} ${movie.year}</a>`;
    seriesList.appendChild(listItem);
    return listItem.querySelector('a');
  });

  links.sort((a, b) => a.textContent.localeCompare(b.textContent));
  links.forEach(link => seriesList.appendChild(link.parentElement));

  const searchInput = document.getElementById('search-input');

  searchInput.addEventListener('input', function() {
    const searchTerm = searchInput.value.trim().toLowerCase();
    links.forEach(link => {
      const movieTitle = link.textContent.trim().toLowerCase();
      if (movieTitle.includes(searchTerm)) {
        link.parentElement.style.display = 'block';
      } else {
        link.parentElement.style.display = 'none';
      }
    });
  });

  const listItems = Array.from(seriesList.getElementsByClassName('movie-item'));
  listItems.sort((a, b) => a.textContent.localeCompare(b.textContent));
  listItems.forEach(item => seriesList.appendChild(item));

  // إضافة مستمع الحدث لكل عنصر في القائمة
  seriesList.addEventListener('click', function(event) {
    const target = event.target;
    if (target && target.classList.contains('movie-item')) {
      const tmdbId = target.dataset.tmdbId;
      if (tmdbId) {
        window.location.href = `movie.html?tmdb_id=${tmdbId}`;
      }
    }
  });

  searchInput.addEventListener('keypress', function(event) {
    if (event.keyCode === 13) {
      event.preventDefault();
      searchInput.blur();
    }
  });

})
.catch(error => {
  console.error('Error:', error);
  seriesList.innerHTML = '<li>فشل في تحميل الافلام قم بتحديث الصفحة</li>';
});
